th:"core/src/lib/actions/customCode.js",settings:{source:'// Extension: Core\n// Action Type: Custom\n// Name: LaunchDataHelper\n// Advanced Options:\n// Wait to run next action\n// Timeout in milliseconds: 2000\nwindow.LaunchDataHelper = (function () {\n  // private stuff goes here\n\n  // public stuff goes here\n  return {\n    // @method storageAvailable\n    // @description Detects whether the Web Storage API methods are available. Types: "localStorage", "sessionStorage", "feature-detect"\n    // @param {String} storageType\n    // @return {Boolean}\n    // @example LaunchDataHelper.storageAvailable("sessionStorage")\n    storageAvailable: function (storageType) {\n      if (typeof storageType === "undefined" || storageType === "") {\n        return false;\n      }\n\n      try {\n        var storage = window[storageType];\n        var testValue = "__lowes_storage_test__";\n        storage.setItem(testValue, testValue);\n        storage.removeItem(testValue);\n        return true;\n      } catch (error) {\n        return false;\n      }\n    },\n    // @method getUrlParameter\n    // @description Get matching parameter from url\n    // @param {String} url - url to search\n    // @param {String} paramName - to look for in url\n    // @return {String} urlParamValue || undefined\n    // @example LaunchDataHelper.getUrlParameter(window.location.href, "");\n    getUrlParameter: function (url, paramName) {\n      url = String(url) || "";\n      paramName = String(paramName) || "";\n      var urlParts = {};\n      var urlParamValue;\n\n      if (url.indexOf(paramName) > -1) {\n        // Clean, parse and assign to key:value in obj\n        var parts = url.replace(/[?&]+([^=&]+)=([^&]*)/gi, function (\n          m,\n          key,\n          value\n        ) {\n          urlParts[key] = value;\n        });\n\n        urlParamValue = urlParts[paramName];\n      }\n\n      return urlParamValue;\n    },\n    // @method get\n    // @description Recursively follows key->value until end of path is reached. If value returns undefined, uses defaultValue. Functions similarly to _.get() with lodash.\n    // @param {Object} fields Object to follow path through.\n    // @param {String} [path] Path to find value for.\n    // @param {*} Any type\n    // @returns {*} Any\n    // @example LaunchDataHelper.get(window.dataLayer, "page.pageInfo.siteID", "default")\n    get: function (fields, path, defaultValue) {\n      // If path was not given\n      if (typeof path === "undefined") {\n        // Return object fields.\n        return fields;\n      }\n\n      // Set current path reference to,\n      var _path = Array.isArray(path)\n        ? // Given \'path\' if already an array.\n          path\n        : // Else, convert String \'path\' to array, with \'.\' delimiters.\n          path.split(/[.[\\]]/).filter(Boolean);\n\n      // If current path does not have a length,\n      if (!_path.length) {\n        // We have reached the end of the path. If undefined value found, use \'defaulValue\' if given. Else, we have found a value, and return it.\n        return typeof fields === "undefined" ? defaultValue : fields;\n      }\n\n      // If fields is undefined at this point,\n      if (typeof fields === "undefined" || fields === null) {\n        // We cannot search further. Return default value.\n        return defaultValue;\n      }\n\n      // Assumes \'fields\' to be an object still...Step through object recursively with next part of path.\n      return LaunchDataHelper.get(fields[_path.shift()], _path, defaultValue);\n    },\n    // @method sha256\n    // @description JavaScript implementation of SHA-256 supporting ASCII\n    // @description derivative of geraintluff.github.io/sha256\n    // @param {String} Parameter to find encoded value for.\n    // @returns {String}\n    // @example LaunchDataHelper.sha256(Lowes, "User.Details.firstName", "default")\n    sha256: function (stringToEncode) {\n      // If string was not given\n      if (\n        typeof stringToEncode === "undefined" ||\n        typeof stringToEncode !== "string"\n      ) {\n        // Return given parameter\n        return stringToEncode;\n      }\n\n      const rightRotate = (value, amount) => {\n        return (value >>> amount) | (value << (32 - amount));\n      };\n\n      let mathPow = Math.pow;\n      let maxWord = mathPow(2, 32);\n      let lengthProperty = "length";\n      let i; // Used as a counter across the whole func\n      let j; // Used as a counter across the whole func\n      let result = "";\n\n      let words = [];\n      let asciiBitLength = stringToEncode[lengthProperty] * 8;\n      let hash = [];\n      let k = [];\n      let primeCounter = 0;\n\n      let isComposite = {};\n      for (let candidate = 2; primeCounter < 64; candidate++) {\n        if (!isComposite[candidate]) {\n          for (i = 0; i < 313; i += candidate) {\n            isComposite[i] = candidate;\n          }\n          hash[primeCounter] = (mathPow(candidate, 0.5) * maxWord) | 0;\n          k[primeCounter++] = (mathPow(candidate, 1 / 3) * maxWord) | 0;\n        }\n      }\n      // Append \u0187\' bit (plus zero padding)\n      stringToEncode += "\\x80";\n      // More zero padding\n      while ((stringToEncode[lengthProperty] % 64) - 56)\n        stringToEncode += "\\x00";\n      for (i = 0; i < stringToEncode[lengthProperty]; i++) {\n        j = stringToEncode.charCodeAt(i);\n        // ASCII check: only accept characters in range 0-255\n        if (j >> 8) return;\n        words[i >> 2] |= j << (((3 - i) % 4) * 8);\n      }\n      words[words[lengthProperty]] = (asciiBitLength / maxWord) | 0;\n      words[words[lengthProperty]] = asciiBitLength;\n\n      // process each chunk\n      for (j = 0; j < words[lengthProperty]; ) {\n        // The message is expanded into 64 words as part of the iteration\n        let w = words.slice(j, (j += 16));\n        let oldHash = hash;\n        // This is now the undefined working hash, often labelled as variables a...g\n        // (we have to truncate as well, otherwise extra entries at the end accumulate\n        hash = hash.slice(0, 8);\n\n        for (i = 0; i < 64; i++) {\n          let i2 = i + j;\n          // Expand the message into 64 words\n          // Used below if\n          let w15 = w[i - 15],\n            w2 = w[i - 2];\n\n          // Iterate\n          let a = hash[0],\n            e = hash[4];\n          let temp1 =\n            hash[7] +\n            (rightRotate(e, 6) ^ rightRotate(e, 11) ^ rightRotate(e, 25)) + // S1\n            ((e & hash[5]) ^ (~e & hash[6])) + // ch\n            k[i] +\n            // Expand the message schedule if needed\n            (w[i] =\n              i < 16\n                ? w[i]\n                : (w[i - 16] +\n                  (rightRotate(w15, 7) ^ rightRotate(w15, 18) ^ (w15 >>> 3)) + // s0\n                    w[i - 7] +\n                    (rightRotate(w2, 17) ^ rightRotate(w2, 19) ^ (w2 >>> 10))) | // s1\n                  0);\n\n          // This is only used once, so *could* be moved below, but it only saves 4 bytes and makes things unreadable\n          let temp2 =\n            (rightRotate(a, 2) ^ rightRotate(a, 13) ^ rightRotate(a, 22)) + // S0\n            ((a & hash[1]) ^ (a & hash[2]) ^ (hash[1] & hash[2])); // maj\n          // We don\'t bother trimming off the extra ones, they\'re harmless as long as we\'re truncating when we do the slice()\n          hash = [(temp1 + temp2) | 0].concat(hash);\n          hash[4] = (hash[4] + temp1) | 0;\n        }\n\n        for (i = 0; i < 8; i++) {\n          hash[i] = (hash[i] + oldHash[i]) | 0;\n        }\n      }\n      // end process chunk\n\n      for (i = 0; i < 8; i++) {\n        for (j = 3; j + 1; j--) {\n          let b = (hash[i] >> (j * 8)) & 255;\n          result += (b < 16 ? 0 : "") + b.toString(16);\n        }\n      }\n\n      return result;\n    }\n  };\n  // end of LDH return\n})();\n// end of LaunchDataHelper\n',language:"javascript"},timeout:2e3,de